            "separator": true,
            "spacing": "none",
            "items": [
                {
                    "type": "TextBlock",
                    "text": "This is a test card",
                    "wrap": true
                }
            ]
        }
    ]
}
```

You can use the following values for the `style` property:

- `emphasis`: The container has a dark background color.
- `good`: The container has a green background color.
- `attention`: The container has a yellow background color.
- `warning`: The container has a red background color.
- `good`, `attention`, or `warning` with `emphasis`: The container has a dark background color with a colored border

## Tooltip Component

```jsx
import React, { createContext, useContext, useState } from 'react';

const TooltipContext = createContext();

export const TooltipProvider = ({ children }) => {
  const [activeTooltip, setActiveTooltip] = useState(null);

  const openTooltip = (id) => {
    setActiveTooltip(id);
  };

  const closeTooltip = () => {
    setActiveTooltip(null);
  };

  return (
    <TooltipContext.Provider value={{ activeTooltip, openTooltip, closeTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};

export const useTooltip = () => useContext(TooltipContext);

const Tooltip = ({ id, children, content }) => {
  const { activeTooltip, openTooltip, closeTooltip } = useTooltip();

  const handleMouseEnter = () => {
    if (activeTooltip !== id) {
      openTooltip(id);
    }
  };

  const handleMouseLeave = () => {
    if (activeTooltip === id) {
      closeTooltip();
    }
  };

  return (
    <div
      onMouseEnter={handleMouseEnter}
      onMouseLeave={handleMouseLeave}
      className={`relative ${activeTooltip === id ? 'z-10' : '-z-10'}`}
    >
      {children}
      {activeTooltip === id && (
        <div className="absolute top-full left-1/2 transform -translate-x-1/2 bg-white border border-gray-300 py-1 px-2 rounded shadow-lg">
          {content}
        </div>
      )}
    </div>
  );
};

export default Tooltip;
```

## Usage

```jsx
import TooltipProvider from '../components/Tooltip';
import Tooltip from '../components/Tooltip';

export default function Home() {
  return (
    <TooltipProvider>
      <div className="p-4">
        <h1 className="text-2xl font-bold mb-4">Tooltip Example</h1>
        <div className="flex gap-4">
          <Tooltip id="tooltip1" content="This is Tooltip 1">
            <button className="px-4 py-2 bg-blue-500 text-white rounded">
              Tooltip 1
            </button>
          </Tooltip>
          <Tooltip id="tooltip2" content="This is Tooltip 2">
            <button className="px-4 py-2 bg-blue-500 text-white rounded">
              Tooltip 2
            </button>
          </Tooltip>
          <Tooltip id="tooltip3" content="This is Tooltip 3">
            <button className="px-4 py-2 bg-blue-500 text-white rounded">
              Tooltip 3
            </button>
          </Tooltip>
        </div>
      </div>
    </TooltipProvider>
  );
}
```

## Explanation

1. Create a `TooltipContext` using `createContext` from React.
2. Create a `TooltipProvider` component that wraps the children and provides the state and functions to manage the active tooltip.
3. Create a `useTooltip` custom hook that returns the `activeTooltip`, `openTooltip`, and `closeTooltip` functions from the context.
4. Create a `Tooltip` component that takes `id`, `children`, and `content` as props.
5. In the `Tooltip` component, use the `useTooltip` hook to access the context values.
6. Add event listeners for `mouseenter` and `mouseleave` events on the tooltip wrapper element.
7. In the `handleMouseEnter` function, check if the current tooltip is not the active tooltip, then open it.
8. In the `handleMouseLeave` function, check if the current tooltip is the active tooltip, then close it.
9. Use the `TooltipProvider` component to wrap the parent component that uses the `Tooltip` component.
